import React from "react";
import "./Projects.css";
import { FaExternalLinkAlt } from "react-icons/fa";

export default function Projects() {
  const projects = [
    {
      title: "ASCO Website",
      desc: "Angular frontend for a medical site with CMS integration, secure login, dynamic filters, and 30+ bug fixes.",
    },
    {
      title: "Verizon System Modernization",
      desc: "Migrated legacy C++ to Java, built full-stack features and REST APIs with 95% test coverage.",
    },
    {
      title: "Speech-to-Text Web App",
      desc: "Browser-based real-time transcription tool with PDF/Word export using JS.",
    },
    {
      title: "Travel Booking Website",
      desc: "Created a travel booking platform using WordPress and a custom frontend.",
    },
    {
      title: "Hand Gesture Recognition",
      desc: "Deep learning system to recognize hand gestures and convert them into text using CNNs.",
    },
  ];

  return (
    <section id="projects" className="projects-section">
      <h2 className="projects-heading">PROJECTS</h2>
      <div className="projects-grid">
        {projects.map((project, index) => (
          <div key={index} className="project-card">
            <h3 className="project-title">{project.title}</h3>
            <p className="project-desc">{project.desc}</p>
            <a href="#" className="project-link">
              View Details <FaExternalLinkAlt size={12} />
            </a>
          </div>
        ))}
      </div>
    </section>
  );
}
